import "./block.css"
//import React from "react";
import React, { useState ,useEffect} from 'react';

function Block(props){



    return(
        <div className = "block-container">
            <div>
                <div className= "index">index {props.blockData.index}</div>
                <div className= "previous-hash">previous hash : {props.blockData.previous_hash}</div>
                <div className= "time">Time {props.blockData.timestamp}</div>
                <div className= "nonce">Nonce {props.blockData.nonce}</div>
                <div className= "data">Data {props.blockData.data.replace("\n"," ")}</div>
            </div>
        </div>
    )

}

export default Block;
